package method;import java.util.Scanner;import java.util.StringTokenizer;class ZeroDominateNumber {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        String input = sc.nextLine();        StringTokenizer st = new StringTokenizer(input, ",");        int i, j;        String s = st.nextToken();        i = Integer.valueOf(s);        s = st.nextToken();        j = Integer.valueOf(s);        System.out.println(countZDN(i, j));    }    static int countZDN(int i, int j) {        int result = 0;        while (i <= j) {            int num = i, count0 = 0, count1 = 0;            if (num == 0) {                result++;                i++;                continue;            }            i++;            while ((num / 2) != 0) {                if (num % 2 == 0) {                    count0++;                } else {                    count1++;                }                num >>= 1;            }            if (count0 > count1) {                result++;            }        }        return result;    }}